    <style>
        html{
            overflow: hidden;
        }
        body{
            height: 100vh;
            backdrop-filter: blur(5px);
            padding: 0%;
            margin: 0%;
            width: 100%;
            background: rgba(0,0,0, .5);
            position: relative;
        }
        .container{
            position: relative;
            max-width: 1100px;
            height: 100%;
            max-height: 100vh;
            margin: 0 auto;
            width: 100%;
            /* min-width: 500px; */
            overflow: hidden;
        }
        .center{
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
        }
        .coming_soon{
            font-size: 70px;
            color: white;
            font-family: sans-serif;
            width: max-content;
            margin: 16px;
        }
        .logo {
            position: absolute;
            top: 5%;
            left: 5%;
            right: 5%;
            display: flex;
            align-content: center;
            align-items: center;
            justify-content: space-between;
            color: white;
        }
        .logo .logo_wrap img{
            width: 100%;    
        }
        .logo .logo_wrap{
            width: 100px;
        }
        .coming_desc{
            color: white;
            text-align: center;
        }
        .follow_us {
            position: absolute;
            bottom: 8%;
            right: 5%;
            color: white;
            font-family: sans-serif;
            font-size: 13px;
            letter-spacing: 2px;
            text-align: right;
        }
        .follow_us .title{
            margin: 8px;
        }
        .follow_us .social_icons {
            display: flex;
            flex-direction: row;
            flex-wrap: nowrap;
            align-content: center;
            justify-content: space-around;
            align-items: center;
        }
        .follow_us .social_icons .social_icon{
            display: block;
            height: 20px;
            width: 20px;
            margin: 8px;
            fill: white;
        }
        .direct_email_number{            
            position: absolute;
            left: 5%;
            bottom: 8%;
        }
        .direct_email_number .item{
            display: flex;
            align-items: center;
            justify-content: flex-start;
            align-content: center;
            flex-wrap: nowrap;
            flex-direction: row;
            fill: white;
            color: white;
        }
        .direct_email_number svg{
            height: 20px;
            width: 20px;
            margin: 8px;
        }
        .text{
            user-select: all;
        }
        a{
            text-decoration: none;
            color: #00f0ff;
            font-weight: bold;
            font-family: monospace;
            font-size: 16px;
        }
        a:hover{
            text-decoration: underline;
        }
    </style>
